pragma solidity ^0.6.0;

import "./ERC721.sol";

contract Demurrage is ERC721 {
    uint256[] public detas;
    mapping(uint256 => bool) _tokenExists;
    uint demurrageFees;
    uint256 deadline;
    uint256 public price = 1 ether;
    address payable Demurrage_collector = 0xdD870fA1b7C4700F2BD7f44238821C26f7392148;

    // function() external payable { }

    constructor() ERC721("Demurrage", "DETA") public {
    }

    function mint(uint256 _value) public {
        require(!_tokenExists[_value], 'Token does not exist');
        detas.push(_value);
        uint _id = detas.length;
        _mint(msg.sender, _id);
        price = price * _value;
        _tokenExists[_id] = true;
    }
    function Fees(uint256 _timeperiod) public returns(uint) {
        return demurrageFees = price * _timeperiod * 1/1000;
    }
    function Prepay(uint256 _timeperiod) public returns(uint256) {
         uint256 _amount = Fees(_timeperiod);
         Make_Payment(Demurrage_collector, _amount);
         deadline = now + (_timeperiod * 1 days);
         return deadline;
    }
    function Make_Payment(address payable _collector, uint256 _amount) public {
       _collector.transfer(_amount);
    }
    function Make_transfer(address payable receiver, uint256 _tokenId) public {
        require(_tokenExists[_tokenId], 'Token does not exist');
        require(now < deadline, 'Deadline is over');
        _transfer(msg.sender, receiver, _tokenId);
    }
    // function getDaiToDeta(uint256 _value) public returns(uint256) {
    //     dai daiToken = dai('0xfE66A9338d78C99Bebf06B35a4BFbe7b5aa0EE9D');
    //     daiToken.transferFrom(msg.sender,address(this),100);
    //     address(this).transfer(100/_value);
    // }
}
